INSERT INTO `film` (`id_film`, `nama_film`, `sutradara`, `genre`, `pemain`, `deskripsi_film`, `tgl_mulai_tayang`, `tgl_selesai_tayang`, `durasi`) VALUES
(1, 'Master Z: The Ip Man Legacy', 'Yuen Woo-ping', 'Action Crime', 'Max Zhang', 'Setelah dikalahkan oleh Ip Man, Cheung Tin Chi (Max Zhang) menjadi depresi dan mulai meninggalkan dunia bela diri. Ia membuka toko kelontong tetapi kemudian mulai mendapatkan masalah ketika terlibat perkelahian dengan pengedar narkoba. Ia kini harus menghadapi pimpinan kartel narkoba terbesar sekaligus pemilik restaurant Davidson (Dave Bautista).', '2019-01-01', '2019-02-01', '120 menit'),
(2, 'Unstoppable (2018)', 'Kim Min Ho', 'Action', 'Ma Dong Seok', 'Don Chul (Ma Dong Seok) dan Ji Soo (Song Ji Hyo) adalah sepasang suami istri yang hidup bahagia walaupun memiliki masalah ekonomi. Suatu hari Ji Soo diculik oleh sekelompok orang tak dikenal. Don Chul yang berbadan besar namun berhati lembut bersama teman-temannya berusaha mencari istrinya dengan pantang menyerah walaupun harus melawan organisasi kejahatan yang berbahaya.', '2019-02-01', '2019-03-22', '116 menit'),
(3, 'App War', 'Yanyong Kuruaungkoul', 'Comedy Romance', 'Nat Kitcharit', 'Bomb dan June, dua pendiri startup aplikasi yang masing-masing memimpin tim mereka untuk membuktikan mana yang terbaik. Mereka bertemu secara kebetulan dan menemukan bahwa mereka memiliki banyak kesamaan. Keduanya saling bersaing untuk mendapatkan hati sang pemilik dana dan maju ke Liga Startup Thailand. Mereka berusaha profesional saat berbisnis, namun keduanya sama-sama saling jatuh hati.', '2019-01-02', '2019-01-09', '130 menit'),
(4, 'Dreadout', 'Kimo Stamboel', 'Horror', 'Marsha Aruan', 'Untuk meningkatkan popularitas mereka, Jessica (Marsha Aruan), Beni (Irsyadillah), Dian (Susan Sameh), Alex (Ciccio Manassero), dan Erik (Jefri Nichol) pergi ke apartemen misterius untuk merekam kegiatan mereka dengan video live. Tetapi mereka menemukan ruangan misterius yang disegel polisi, mereka masuk dan secara tidak sengaja membuka portal misterius yang menyeret mereka semua ke neraka.', '2019-01-03', '2019-01-27', '128 menit'),
(5, 'Keluarga Cemara', 'Yandy Laurens', 'Drama', 'Ringgo Agus Rahman', 'Abah (Ringgo Agus Rahman) mengalami cobaan yang paling berat ketika harta dan rumahnya disita oleh Debt Collector untuk membaya hutang karena ulah kakak iparnya. Merka pindah sementara ke desa terpencil di Jawa Barat yag merupakan warisan ayahnya. Abah kini harus hidup dalam kemiskinan bersama keluarga kecilnya, Emak (Nirina Zubir), Euis (Adhisty Zara) dan Ara (Widuri Putri). Mereka harus bertahan dengan masalah-masalah yang timbul.', '2019-01-03', '2019-04-12', '110 menit'),
(6, 'Simmba', 'Rohit Shetty', 'Action Comedy', 'Ranveer Singh', 'Simmba (Ranveer Singh) adalah yatim piatu yang kini menjadi polisi. Ia menjadi polisi yang korup dan ia menikmati hal tersebut. Tetapi ketika orang yang ia cintai diculik, ia menemukan bahwa dirinya berubah dan memilih untuk menjadi polisi yang baik.', '2019-04-01', '2019-01-15', ' 158 menit'),
(7, 'Elliot The Littlest reindeer', 'Jennifer Westcott', 'Animation', 'Josh Hutcherson', 'Elliot (Josh Hutcherson), seekor kuda mini yang juga punya mimpi tinggi untuk menjadi salah satu penarik kereta Santa Claus. Berbagai usaha dilakukan Elliot untuk menarik perhatian pemiliknya, Walter (Rob Tinkler) dan juga pelatihnya, Clyde (Jeff Dunham). Ia tak menyerah sekalipun selalu mendapat intimidasi dari DJ (Christopher Jacot), seekor Rusa unggulan dari tempat yang sama dengan Ia tinggal.', '2019-01-05', '2019-01-10', '89 menit'),
(8, 'Swing Kids', 'Kang Hyeong Cheol', 'Drama Musical', 'Do Kyung Soo', 'Ketia Perang Korea pada tahun 1951 disebuah camp penjara, Ro Ki-doo (Do Kyung-soo) seorang pemberontak dari Korea Utara jatuh cinta dengan tap dance setelah bertemu Jackson. Ia kemudian bergabung dengan Jackson untuk membentuk grup dansa.', '2019-01-09', '2019-01-27', '133 menit'),
(9, 'How to Train Your Dragon: The Hidden World', 'Dean DeBlois', 'Animation', 'Jay Baruchel', 'Setelah menjadi kepala suku Berk, Hiccup (Jay Baruchel) ingin mewujudkan mimpinya untuk membuat surga bagi para naga. Ketika bahaya kembali mengancam desa mereka, Hiccup dan Toothless pergi meninggalkan kampung halaman mereka menuju negeri tersembunyi yang hanya ada dilegenda untuk menemukan cara mengalahkan musuh mereka yang berbahaya.', '2019-01-09', '2019-02-13', '104 menit'),
(10, 'After Met You', 'Patrick Effendi', 'Drama Romance', 'Ari Irham', 'Ari (Ari Irham) merupakan pria terkeren di sekolahnya diajak taruhan untuk mencari pacar oleh teman-temannya. Ara (Yoriko Angeline) merupakan gadis pintar di sekolah yang menjadi target Ari. Ternyata Ara adalah anak dari produser label DJ tempat Ari bernaung. Sementara itu Azka sahabat lama Ari datang dan kemudian dekat dengan Ara.', '2019-01-10', '2019-02-21', '107 menit'),
(11, 'Perjanjian Dengan Iblis', 'Ardy Octaviand', 'Horror', 'Shandy Aulia', 'Annisa (Shandy Aulia) menikah dengan duda bernama Bara (Aghi Narottama) yang telah memiliki anak perempuan bernama Lara. Bara ingin agar mereka akbrab dan mengajaknya kepulau yang jarang dikunjungi wisatawan yaitu Pulau Bengalor. Tetapi mereka mengalami kejadian mengerikan dengan munculnya penampakan anak kecil yang wajahnya menyeramkan serta penampakan Ibu Lara yang sudah tiada.', '2019-01-10', '2019-01-23', '80 menit'),
(12, 'Lagi-lagi Ateng', 'Monty Tiwa', 'Comedy Drama', 'Augie Fantinus', 'Ateng (Augie Fantinus) dan Iskak (Soleh Solihun) untuk pertama kalinya pergi ke Jakarta. Disana ia bertemu dengan Agung pengusaha sukses yang bentuknya mirip dengan Ateng, ternyata mereka dulunya adalah saudara kembar yang terpisahkan. Orangtua mereka masih lengkap dan mereka memiliki ide untuk bertukar tempat untuk bertemu orangtua yang belum pernah mereka temui.', '2019-01-16', '2019-02-16', '108 menit'),
(13, 'The Accidental Prime Minister', 'Vijay Gutte', 'Drama Biography', 'Anupam Kher', 'Berdasarkan kisah nyata tentang Perdana Mentri India bernama Manmohan Singh. Bagaimana kisah ia mengatur kabinetnya dan juga mengatur negaranya.', '2019-02-12', '2019-03-12', '112 menit'),
(14, 'Escape Room', 'Adam Robitel', 'Drama Thriller', 'Deborah Ann Woll', 'Beranggapan bahwa ini hanya permainan biasa, Amanda (Deborah Ann Woll), Zoey (Taylor Russell), Ben (Logan Miller), Danny (Nik Dodani), Mike (Tyler Labine), dan Jason (Jay Ellis) awalnya santai dalam mencari petunjuk demi bisa lanjut ke babak berikutnya. Namun ketika jebakan di ruangan pertama mulai aktif, yaitu dengan munculnya pemanas yang di sekeliling ruangan. Bak di dalam oven, enam orang ini terancam jiwanya dan berusaha mati-matian demi bertahan hidup.Tantangan yang berat, menuntut enam orang ini untuk bekerja sama dalam mencari petunjuk. Namun dengan ego yang berbeda-beda, selalu ada saja yang tewas dan menjadi korban dari ruangan mematikan. Siapakah yang akan berhasil lolos dari Escape Room?', '2019-04-01', '2019-05-13', '100 menit'),
(15, 'Replicas', 'Jeffrey Nachmanoff', 'Mystery Crime Science', 'Keanu Reeves', 'Seorang ilmuwan pakar biologi buatan bernama William Foster (Keanu Reeves) menemukan cara untuk memindahkan kemampuan otak dan neuron seseorang. Ketika keluarganya tewas dalam kecelakaan mobil, ia menggunakan kemampuannya untuk mengkloning dan menghidupkan kembali keluarganya. Tetapi perusahaannya menganggap bahwa kloningan tersebut merupakan properti milik perusahaan.', '2019-02-13', '2019-03-20', '107 menit'),
(16, 'Take Point', 'Kim Byung Woo', 'Action', 'Ha Jung Woo', 'Pada hari pemilihan Presiden Amerika tahun 2024, seorang kapten bernama Ahab dengan 12 pasukannya mendapatkan misi dari CIA. Mereka harus menangkap pimpinan tentara Korea Utara didalam bunker yang masih masuk dalam area DMZ (Korean Demilitarized Zone)', '2019-02-24', '2019-04-02', '119 menit'),
(17, 'Mojin: The Worm Valley', 'Fei Xing', 'Action', 'Yusi Chen', 'Seorang penjelajah legendaris bernama Hu Bayi dalam misi yang berbahaya untuk mencari makam Emperor Xian. Makam tersebut terletak di pulau misterius yang berisi mahluk-mahluk misterius dan monster.', '2019-03-01', '2019-04-10', '110 menit'),
(18, 'Glass', 'M.Night Shyamalan', 'Action Thriller', 'Bruce Willis', 'David Dunn (Bruce Willis) mengejar Kevin Wendell (James McAvoy) ketika mereka beberapa kali bertemu. David Dunn penasaran dengan pribadi Kevin ketika pribadi monster keluar dari tubuhnya. Sementara itu Elijah Price (Samuel L. Jackson) yang mengatur mereka berdua secara diam-diam dan memegang kunci rahasia kedua orang tersebut.', '2019-03-03', '2019-04-12', '128 menit'),
(19, 'Terima Kasih Cinta', 'Tema Patrosza', 'Drama', 'Putri Marino', 'Eva (Putri Marino) memiliki kehidupan yang bahagia. Tetapi penyakit mematikan menyerangnya dan langsung saja hidupnya dan hari-harinya menjadi pilu dan menyedihkan. Tetapi ia tetap berjuang untuk bertahan hidup, mempertahankan prestasi dan juga cinta. Untungnya masih ada orang-orang yang saya kepadanya.', '2019-04-13', '2019-05-05', '101 menit'),
(20, 'Mata Batin 2', 'Rocky Soraya', 'Horror', 'Jessica Mila', 'Alia (Jessica Mila) memulai kehidupan baru setelah adiknya meninggal dan tinggal di Panti Asuhan milik Bu Laksmi (Sophia Latjuba) dan Pak Fadli (Jeremy Thomas). Tetapi ada yang janggal di panti asuhan tersebut apalagi salah satu anak panti asuhan tersebut yaitu Nadia (Nabilah Ayu) juga terbuka mata batinnya seperti Alia yang bisa mendengar suara minta tolong dari seluruh dinding rumah.', '2019-04-05', '2019-05-01', '115 menit'),
(21, 'Preman Pensiun', 'Aris Nugraha', 'Comedy', 'Epy Kusnandar', 'Setelah 3 tahun bisnis Muslihat (Epy Kusnandar) mulai mengalami masalah, ia sudah pensiun sebagai preman. Apalagi anaknya Safira mulai tumbuh remaja dan banyak laki-laki mendatanginya. Masalah semakin rumit ketika diantara mantan anak buahnya terjadi keributan.', '2019-05-04', '2019-06-07', '94 menit'),
(22, 'Twiceland: Twice Movie', 'Park Jin Young', 'Musical', 'Twice', 'Menampilkan band Twice dalam tur konser Twiceland Zone 2: Fantasy Park sepanjang tahun 2018, termasuk diantaranya di Singapura, Thailand, dan Jakarta.', '2019-05-11', '2019-06-20', '110 menit'),
(23, 'Backtrace', 'Brian A. Miller', 'Drama Crime', 'Matthew Modine', 'Dalam perampokan bank yang berakhir buruk, hanya MacDonald (Matthew Modine) yang berhasil selamat dan hilang ingatan. Ia berhasil melarikan diri dari penjara dan Sykes (Sylvester Stallone) yang merupakan seorang detektif ditugaskan untuk mencarinya.', '2019-05-12', '2019-06-14', '92 menit'),
(24, 'Tabu', 'Angling Sagaran', 'Horror', 'Angga Aldi Yunanda', '6 orang yang berteman Diaz, Keyla, Tio, Adis, Muti, dan Mahir melakukan hal yang tabu dan terlarang disebuah hutan Leuweung Hejo. Sejak itu kejadian aneh mulai mengikuti mereka. Apalagi mereka membawa pulang bocah misterius yang ternyata menjadi perantara arwah-arwah yang sudah ratusan tahun terkunci di Leuweung Hejo.', '2019-05-14', '2019-06-27', '96 menit'),
(25, 'Hell Fest', 'Gregory Plotkin', 'Horror', 'Amy Forsyth', 'Pembunuh berantai bertopeng merubah sebuah taman hiburan yang bertema horror menjadi area bermainnya. Ia menteror sekelompok orang yang saling berteman, sementara para pengunjung lainnya menganggap bahwa terror yang dilakukannya merupakan bagian dari pertunjukan di taman hiburan tersebut.', '2019-05-17', '2019-06-28', '89 menit'),
(26, 'Welcome Home', 'George Ratliff', 'Thriller', 'Aaron Paul', 'Pasangan Bryan (Aaron Paul) dan Cassie (Emily Ratajkowski) mencoba memperbaiki hubungan mereka dengan berlibur ke Italia. Mereka menyewa rumah milik Federico (Riccardo Scarmarcio) yang ternyata memiliki rencana jahat tersembunyi.', '2018-05-22', '2018-07-01', '97 menit'),
(27, 'The Kid Who Would Be King', 'Joe Cornish', 'Family', 'Louis Ashbourne Serkis', 'Alex Elliot (Louis Ashbourne Serkis) merupakan anak laki-laki yang berbeda di sekolahnya. Tetapi ketika ia menemukan dan mengangkat pedang Excalibur milik raja Arthur, ia menyadari bahwa ia dipilih untuk melawan Morgana (Rebecca Ferguson). Ia dibantu Merlin (Patrick Stewart) untuk membantu Alex mengalahkan Morgana.', '2018-01-09', '2018-02-11', '120 menit'),
(28, 'Matt dan Mou', 'Monty Tiwa', 'Drama', 'Maxime Bouttier', 'Matt (Maxime Bouttier) dan Mou (Prilly Latuconsina) adalah dua orang sahabat yang sudah berteman sejak kecil walaupun sifat mereka saling bertolak belakang. Matt sangat over protektif terhadap Mou termasuk ketika ada Reza (Irsyadillah) yang mendekati Mou. Matt kemudian menjodohkan Mou dengan Retha (Josephine Firmstone) agar ia tidak terus mengganggunya.', '2018-01-10', '2018-02-18', '96 menit'),
(29, 'Orang Kaya Baru The Movie', 'Ody C. Harahap', 'Drama Comedy', 'Raline Shah', 'Tiga orang kaka beradik Tika (Raline Shah), Duta (Derby Romero) dan Dodi (Fatih Unru) sudah terbiasa hidup pas-pasan karena memang keluarga mereka sederhana. Mereka sudah terbiasa berusaha keras untuk mendapatkan sesuatu dan mensyukurinya. Tetapi ketika Ayah (Lukman Sardi) mereka meninggal dunia, mereka menjadi syok karena Ayah mereka merupakan segalanya bagi mereka. Tetapi yang lebih mengejutkan ternyata Ayah mereka kaya raya dan seketika saja mereka tiba-tiba menjadi orang yang sangat kaya.', '2018-01-22', '2018-03-03', '99 menit'),
(30, 'Instant Family', 'Sean Anders', 'Drama Comedy', 'Mark Wahlberg', 'Ketika Pete (Mark Wahlberg) dan Ellie (Rose Byrne) berencana untuk membentuk keluarga mereka akhirnya memutuskan untuk mengadopsi anak. Mereka berencana mengadopsi seorang anak kecil tetapi mereka malah bertemu 3 bersaudara dimana salah satunya adalah gadis pemberontak berusia 15 tahun. Sekarang Pete dan Ellie harus belajar mengasuh 3 anak secara instant agar mereka menjadi keluarga.', '2018-02-14', '2018-03-15', '118 menit'),
(31, 'Manikarnika: The Queen Of Jhansi', 'Radha Krishna Jagarlamudi', 'Action Biography', 'Kangana Ranaut', 'Menceritakan kisah hidup dari Rani Lakshmibai (Kangana Ranaut) yang merupakan salah satu kunci pemimpin India ketika memberontak melawan Inggris pada tahun 1857.', '2018-03-18', '2018-04-03', '148 menit'),
(32, 'Thackeray', 'Abhijit Panse', 'Drama Biography', 'Nawazuddin Siddiqui', 'Menceritakan biografi tentang kehidupan Balasaheb Thackeray (Nawazuddin Siddiqui) dan juga kehidupannya bersama istrinya Meena Tai Thackeray (Amrita Rao). Pendiri partai politik yang terkenal di India, Shiv Sena.', '2018-04-28', '2018-05-30', '120 menit'),
(33, 'BTS World Tour: Love Yourself', 'Big Hit Entertaiment', 'Musical', 'BTS', 'Disyuting di Olympic Stadium di Seoul dalam rangka BTS World Tour: Love Yourself.', '2018-04-11', '2018-05-27', '130 menit'),
(34, 'THe Upside', 'Neil Burger', 'Drama Comedy', 'Bryan Cranston', 'Phillip (Bryan Cranston) merupakan orang kaya yang menderita penyakit sehingga harus dibantu untuk melakukan kegiatan hariannya di New York. Ia membayar Dell (Kevin Hart) yang sedang bermasalah berusaha dekat lagi dengan mantan istrinya dan anaknya. Walaupun dari 2 dunia yang berbeda, persahabatan mereka ternyata mulai terbentuk.', '2018-05-05', '2018-06-03', '126 menit'),
(35, 'Close', 'Vicky Jewson', 'Action Thriller', 'Noomi Rapace', 'Seorang bodyguard dan juga merupakan pasukan anti teroris bernama Sam (Noomi Rapace) mendapatkan tugas untuk melindungi Zoe (Sophie Nelisse). Zoe merupakan pewaris tahta yang sangat kaya, mereka berdua tidak akur dan selalu melanggar perjanjian hingga komplotan penculik memksa mereka untuk bersama-sama melarikan diri.', '2018-05-11', '2018-06-07', '94 menit'),
(36, 'The Mermaid: Lake of the Dead', 'Svyatoslav Podgayevskiy', 'Fantasy Horror Romance', 'Viktoriya Agalakova', 'Seorang makhluk air jatuh cinta kepada seorang pria yang sudah bertunangan. Ia ingin membawanya kekerajaan bawah air miliknya dimana ia dikutuk untuk menghabiskan hidup disana selamanya.', '2018-05-22', '2018-06-11', '90 menit'),
(37, 'Green Book', 'Peter Farrely', 'Comedy Biography', 'Mahersala Ali', 'Dr. Don Shirley (Mahersala Ali) merupakan pianis terkenal keturunan Afrika-Amerika yang akan mengadakan konser pada tahun 1962. Ia membutuhkan supir dan bodyguard sehingga ia merekrut Tony Lip (Viggo Mortensen) yang berasal dari Bronx. Walaupun mereka berbeda, tetapi 2 pria ini dapat menjalin persahabatan diera dimana rasis masih merajalela.', '2018-05-29', '2018-07-02', '130 menit'),
(38, 'The Mule', 'Clint Eastwood', 'Drama Thriller', 'Client Eastwood', 'Berdasarkan kisah nyata dari Leo Sharp veteran perang dunia II yang menjadi kurir narkoba. Earl Stone - Leo Sharp (Client Eastwood) seorang ahli pertanian berusia 90 tahun dan mantan tentara pada Perang Korea sekarang menghadapi masalah keuangan dan masalah keluarga. Ia akhirnya memutuskan menjadi kurir pengantar Narkoba karena usianya dan latar belakangnya membuat ia tidak dicurigai. Segera saja banyak kartel yang mempercayainya untuk menjadi kurir narkoba.', '2018-06-08', '2018-07-10', '116 menit'),
(39, 'Destroyer', 'Karyn Kusama', 'Action Drama', 'Nicole Kidman', 'Seorang detektif muda dari kepolisian LAPD bernama Erin Bell (Nicole Kidman) menyusup masuk ke gang kriminal yang berakhir tragis. Bell melanjutkan kerja sebagai detektif tetapi perasaan bersalah dan marah terus menghantui dirinya. Ketika pimpinan kriminal tersebut muncul kembali, ia terobsesi untuk menemukan anak buahnya agar bisa membawanya kepada pimpinannya untuk menegakkan keadilan.', '2018-06-12', '2018-07-18', '121 menit'),
(40, 'Babe', 'Hasto Broto', 'Drama', 'Zoe Abbas Jackson', 'Seorang peneliti cantik yang bernama Betty de Bosch (Zoe Abbas Jackson) datang dari Universitas Leiden Belanda ke Bekasi. Ali (Dwi Andhika) seorang anak kampung Bekasi terpikat dan jatuh cinta dengannya. Tetapi hubungan mereka tidak berjalan mulus dengan munculnya masalah-masalah baru salah satunya larangan dari Baba Jiung (Ridwan Saidi) yang menganggap Belanda pernah menjajah Batavia dan tanah Betawi.', '2018-06-14', '2018-07-15', '92 menit'),
(41, 'Tembang Lingsir', 'Rizal Mantovani', 'Horror', 'Marsha Aruan', 'Sejak kecil Mala (Marsha Aruan) telah diajarkan Ibunya menyanyikan Tembang Lingsir. Tetapi ketika kebakaran misterius terjadi menyebabkan Ibunya tewas dan Mala kehilangan suaranya. Mala kemudian tinggal bersama pamannya Om Gatot (Teuku Rifnu Wikana) dan Tante Gladys (Meisya Siregar) yang memiliki 2 anak. Tetapi berbagai macam kejadian misterius mulai muncul sejak Mala tinggal merasa mereka, mereka menuduh Mala penyebabnya tetapi Mala justru merasa ada rahasia tersembunyi di rumah tersebut.', '2018-06-20', '2018-07-24', '90 menit'),
(42, 'Terlalu Tampan', 'Sabrina Rochelle Kalangie', 'Drama Comedy', 'Ari Irham', 'Kulin (Ari Irham) merupakan cowok yang terlalu tampan yang selalu menghindari sekolah dan memilih menghabiskan waktunya di rumah. Hal ini membuat keluarganya khawatir dan membuat rencana agar Kulin mau menghabiskan tahun terakhirnya di SMA. Tetapi ketampananannya membuat banyak guru-guru wanita pingsan dan ia juga menjadi incaran siswi-siswi SMA.', '2018-06-29', '2018-07-30', '106 menit'),
(43, 'PSP: Gaya Mahasiswa', 'Hilman Mutasi', 'Drama Comedy', 'Boris Bokir', 'Mahasiswa-mahasiswa yang gokil dan jahil serta pintar dalam bermusik diantaranya adalah Rojali (Boris Bokir), Monos (Imam Darto) dan Ade (Abdurrahim Arsyad) yang ketiganya cowok flamboyan. Ada lagi Dindin (Uus), Andra (David John Schaap) dan Adit (Wira Setianagara) yang merupakan pembuat masalah. Serta dua orang culun yaitu Omen (Adjisdoaibu) dan James (Dimas Danang). Mereka selalu membuat kehebohan di kampus hingga terkena sanksi Drop Out.', '2018-07-02', '2018-08-08', '96 menit'),
(44, 'Serenity', 'Steven Knight', 'Drama Thriller', 'Matthew McConaughey', 'Baker Dill (Matthew McConaughey) adalah seorang kapten kapal yang menyediakan tur keliling kepulauan Plymouth. Hidupnya mulai terganggu ketika mantan istrinya Karen (Anne Hathaway) memohon meminta tolong untuk menyelamatkannya dan anaknya dari suaminya yang kejam dan kasar. Karen meminta Baker mengajak suaminya untuk memancing dan melemparnya kelaut agar dimakan ikan hiu.', '2018-07-06', '2018-08-14', '106 menit'),
(45, 'Uri: The Surgical Strike', 'Aditya Dhar', 'Action Drama', 'Vicky Kaushal', 'Menceritakan kejadian penyerangan pasukan India ke markas Uri militan Pakistan. Sebuah operasi militer yang terdiri dari 11 kejadian dan misi untuk menyerang Uri. Berdasarkan kisah nyata atas penyerangan Uri ditahun 2016.', '2018-07-15', '2018-08-20', '138 menit'),
(46, 'Alita: Battle Angel', 'Robert Rodriguez', 'Adventure Animation', 'Rosa Salazar', 'Bercerita pada zaman dimana dunia baru saja hancur karena kegagalan teknologi. Alita (Rosa Salazar) sebuah robot inti ditemukan tanpa tubuh dan memory oleh Dr. Ido (Christoph Waltz). Ia kemudian memberikan Alita tubuh baru, dan sedikit demi sedikit berhasil terungkap bahwa Alita punya masa lalu yang luar biasa.', '2018-07-22', '2018-09-02', '122 menit'),
(47, 'The Knight of Shadows: Between Yin and Yang', 'Yan Jia', 'Action Fantasy', 'Jackie Chan', 'Seorang pemburu monster legendaris bernama Pu Songling (Jackie Chan) sedang mengejar mahluk mengerikan yang memasuki dunia manusia. Ia dibantu oleh muridnya dan sekelompok monster yang baik hati untuk menangkap mahluk tersebut.', '2018-07-28', '2018-08-08', '109 menit'),
(48, 'Bernie The Dolphin', 'Kirk Harris', 'Family Comedy', 'Lola Sultan', 'St. Agustine, Florida, seorang kakak beradik bernama Holly (Lola Sultan) dan Kevin (Logan Allen) berteman dengan seekor ikan lumba-lumba yang kulitnya terbakar matahari dan terpisah dari kelompoknya. Mereka juga menemukan sebuah rencana rahasia yang dapat menghancurkan pantai dan rumah dari lumba-lumba teman mereka. Kini mereka harus mempunyai rencana untuk menghentikan para penjahat dan melindungi kehidupan laut terutama teman baru mereka Bernie si lumba-lumba.', '2018-08-04', '2018-09-06', '88 menit'),
(49, 'Laundry Show', 'Rizki Balki', 'Drama Comedy', 'Boy William', 'Uki (Boy William) bosan dengan karirnya yang itu-itu saja, sehingga ia memutuskan berhenti bekerja dan membuka Laundry Halilintar. Ternyata perjalanan membuka usaha tidak mudah terutama menghadapi tingkah laku pegawai-pegawainya yang konyol. Persaingan berat mulai muncul ketika Agustina (Gisella Anastasia) hadir dan membuka Laundry didekat lokasi Laundry Halilintar.', '2018-08-10', '2018-09-15', '97 menit'),
(50, 'The Way I Love You', 'Rudi Aryanto', 'Drama Romance', 'Syifa Hadju', 'Senja (Syifa Hadju) tidak pernah mengetahui siapa laki-laki bernama BadBoy yang sering chatting dengannya di dunia maya. Yang jelas Senja menikmati percakapan tersebut, dan sering mengingat pembicaraan mereka. Tetapi ketika mereka akhirnya bertemu dan ia bernama Rasya (Baskara Mahendra), Senja menyadari kegilaan yang terjadi atas nama cinta. Tetapi semakin dekat dengan Rasya, Senja justru merasa perasaannya berbeda ketika ia berkomunikasi chatting dengan BadBoy di dunia maya.', '2018-08-18', '2018-09-22', '94 menit'),
(51, 'Satu Suro', 'Anggy Umbara', 'Horror', 'Citra Kirana', 'Adinda (Citra Kirana) yang sedang hamil pindah rumah di pinggiran kota bersama Bayu (Nino Fernandez) suaminya. Rumah tersebut merupakan pemberian paman Bayu, tetapi banyak kejadian aneh di rumah tersebut. Ketika Adinda kontraksi, Bayu mengantarnya ke rumah sakit terdekat tetapi dokter mengatakan belum waktunya Dinda melahirkan maka Bayu meninggalkan Dinda sebentar untuk mengambil keperluan yang tertinggal. Ketika Bayu kembali ke rumah sakit, ia hanya menemukan bangunan tua yang kosong dan bekas terbakar. Ia menanyakan penduduk sekitar yang mengatakan rumah sakit tersebut sudah tidak beroperasi sejak 15 tahun yang lalu ketika terjadi kebakaran. Bayu nekat masuk ke rumah sakit untuk menemukan Adinda dan juga calon anak yang dikandungnya.', '2018-08-21', '2018-09-30', '94 menit'),
(52, 'The Lego Movie 2: The Second Part', 'Mike Mitchell', 'Adventure Animation', 'Chris Pratt', '5 tahun setelah kejadian difilms pertama, dan semuanya berjalan normal. Tetapi penduduk Bricksburg harus menghadapi ancaman baru ketika Lego Duplo datang dari luar angkasa yang menghancurkan semua yang dilewatinya. Emmet (Chris Pratt), Lucy (Elizabeth Banks), Batman (Will Arnett) dan teman-teman lainnya harus pergi keluar angkasa, kedunia yang belum terjamah.', '2018-09-01', '2018-10-02', '106 menit'),
(53, 'Isabelle', 'Rob Heydon', 'Horror Thriller', 'Adam Brody', 'Pasangan muda Matt (Adam Brody) dan Larissa (Amanda Crew) pindah ke New England untuk memulai kehidupan baru dan berkeluarga. Tetapi kehadiran iblis mengerikan membuat mereka harus bertahan hidup dari kekuatan jahat yang menginginkan nyawa mereka.', '2018-09-08', '2018-10-10', '81 menit'),
(54, 'Happy Death Day 2U', 'Christopher Landon', 'Horror Thriller', 'Jessica Rothe', '2 tahun setelah kejadian difilms pertama, Tree Gelbman (Jessica Rothe) secara tidak sengaja masuk kembali ke lingkaran waktu yang berulang-ulang. Ia berusaha untuk keluar apalagi setelah mengetahui temannya juga ikut kedalam lingkaran waktu. Kini ia merasa bahwa berada dilingkaran waktu dan mati berulang kali terasa lebih menyenangkan daripada menghadapi bahaya yang mengancam didepannya.', '2018-09-10', '2018-10-15', '100 menit'),
(55, 'Second Act', 'Peter Segal', 'Comedy Romance', 'Jennifer Lopez', 'Maya Vargas (Jennifer Lopez) terjebak dipekerjaannya yang bergaji rendah di pasar swalayan. Tetapi ia mendapat kesempatan tak terduga ketika sebuah perusahaan keuangan menyangka bahwa Maya adalah konsultan terkenal. Perusahaan tersebut memperkerjakannya untuk menangani perjanjian bisnis yang bernilai tinggi.', '2018-09-14', '2018-10-19', '103 menit'),
(56, 'The Dude In Me', 'Kang Hyo Jin', 'Comedy Fantasy', 'Jung Jin Young', 'Sebuah kecelakaan yang tidak terduga, ketika Dong-hyun (Jung jin-young) anak SMA terjatuh dari atap dan menimpa Pan-soo (Park Sung-woong) seorang mafia. Ketika mereka berdua terbangun di rumah sakit, mereka menyadari bahwa tubuh mereka telah tertukar.', '2018-09-20', '2018-10-20', '122 menit'),
(57, 'Mobile Suit Gundam Narrative', 'Toshikazu Yoshizawa', 'Animation', 'Junya Enoki', 'Setahun setelah kota Laplace terbuka yang menyebabkan konflik. Pasukan Neo Zeon yang tersisa akhirnya hancur, Banshee dan Unicorn Gundam dikunci agar tidak terlihat oleh masyarakat dan berharap dilupakan dari sejarah. Tetapi kemunculan Gundam lain yaitu Unicorn Gundam 03 Phenex yang dikabarkan telah hilang 2 tahun yang lalu tiba-tiba muncul kembali.', '2018-09-21', '2019-10-25', '88 menit'),
(58, 'Calon Bini', 'Asep Kusdinar', 'Drama', 'Michelle Ziudith', 'Pak Lik Agung ingin menjadi kepala desan dan memaksa Ningsih (Michelle Ziudith) untuk menikah dengan Sapto (Dian Sidik). Tetapi Ningsih ingin melanjutkan kuliahnya yang tidak mungkin diwujudkan karena kondisi perekonomian keluarga yang tidak mampu. Ningsih memutuskan untuk kabur ke Jakarta yang membuat Pak Lik Agung kalang kabut. Di Jakarta ia bekerja di keluarga Pak Prawira (Slamet Rahardjo)', '2018-09-28', '2018-10-05', '96 menit'),
(59, 'The Man from the Sea (Laut)', 'Koji Fukada', 'Drama Fantasy', 'Dean Fujioka', 'Seorang lelaki misterius (Dean Fujioka) ditemukan di sebuah pantai di Banda Aceh oleh Atsuko (Mayu Tsuruta) yang bekerja sebagai petugas penanggulan bencana. Mereka merawat lelaki tersebut dan memberinya nama Laut. Mereka dan teman-teman lainnya seperti Kris (Adipati Dolken) dan Ilma (Sekar Sari) akhirnya menjalin persahabatan. Sementara Laut mulai melakukan keajaiban-keajaiban yang membuat orang curiga.', '2018-10-02', '2018-11-10', '107 menit'),
(60, 'Antologi Rasa', 'Rizal Mantovani', 'Drama Romance', 'Herjunot Ali', 'Persahabatan empat orang yang menjadi kompleks antara Keara (Carissa Perusset), Harris (Herjunot Ali), Ruly (Refal Hadi) dan Denise (Atikah Suhaime). Ternyata mereka diam-diam saling mencintai tetapi cinta mereka tidak terbalas satu sama lain. Keara mencintai Ruly, Harris mencintai Keara dan Ruly yang mencintai Denise.', '2018-10-12', '2018-11-18', '104 menit'),
(61, 'Kain Kafan Hitam', 'Yudhistira Bayuadji', 'Horror', 'Haico Van Der Veken', 'Evelyn (Haico Van Der Veken) kuliah di Bandung yang memiliki 2 orang adik yaitu Arya (Rayhan Cornellis) dan Maya (Jessica Lucyana Taroreh). Evelyn memiliki pacar bernama Bimo (Maxime Bouttier) yang hobi dengan segala sesuatu tentang horror bahkan memiliki komunitas pencari setan di kampusnya. Ketika orangtua Evelyn meninggal karena kecelakaan, Evelyn dan adik-adiknya harus pindah ke rumah lain karena rumah yang lama digadai oleh bank. Tetapi ruma baru tersebut justru menyimpan misteri.', '2018-10-16', '2018-11-10', '76 menit'),
(62, 'Gully Boy', 'Zoya Akhtar', 'Musical Romance', 'Ranveer Singh', 'Murad (Ranveer Singh) berasal dari daerah perkampungan Mumbai, India. Ia adalah anak seorang supir yang orangtuanya bekerja keras agar ia dapat sekolah dan bekerja ditempat yang layak. Tetapi Murad ingin menjadi penyanyi rapper, ia besar di jalanan dan ingin mengejar mimpinya untuk menjadi penyanyi Rap terkenal.', '2018-10-20', '2018-11-11', '153 menit'),
(63, 'Cold Pursuit', 'Hans Petter Moland', 'Action Thriller', 'Liam Neeson', 'Nelson (Liam Neeson) hidup tenang dan damai sebagai pembersih salju, tetapi semua itu berubah ketika anak laki-lakinya meninggal secara misterius. Pencariannya untuk menemukan fakta menuntunnya kesebuah bandar narkoba bernama Viking dan anak buahnya. Kehidupannya berubah dari warga biasa menjadi orang kejam berdarah dingin yang ingin membalas dendam kematian anaknya.', '2018-10-25', '2019-11-25', '118 menit'),
(64, 'The Prodigy', 'Micholas McCarthy', 'Horror Thriller', 'Taylor Schilling', 'Sarah (Taylor Schilling) dan John (Peter Mooney) bahagia ketika anak mereka Miles (Jackson Robert Scott) mengalami perkembangan pesat dan sangat cerdas. Tetapi semuanya berubah menjadi mengerikan ketika perilakunya menjadi kasar dan mengerikan pada ulang tahun ke 8. Setelah meminta bantuan, mereka mengetahui bahwa ada kekuatan supranatural dibelakang Miles yang membuatnya berperilaku kasar dan mengerikan.', '2018-10-28', '2018-11-30', '92 menit'),
(65, 'Dragon Ball Super: Broly', 'Tatsuya Nagamine', 'Animation Fantasy', 'Ryo Horikawa', 'Setelah kehancuran Planet Vegeta, 3 orang saiya berhasil melarikan diri untuk menghadapi nasib yang berbeda-beda. 2 Diantaranya yaitu Goku dan Vegeta sekarang menemukan rumah mereka di bumi. Goku dan Vegeta terus berlatih untuk menghadapi musuh-musuh kuat yang akan muncul. Tetapi mereka tidak menyangka bahwa lawan mereka kali ini adalah Broly, salah satu Saiya yang lolos dari Planet Vegeta.', '2018-11-03', '2018-12-10', '60 menit'),
(66, 'Ghost Wife', 'Mate Yimsomboon', 'Horror', 'Supawadee Kitisopaku', 'Nard (Supawadee Kitisopaku) seorang anak SMA yang jatuh cinta dengan kakak kelasnya yang bernama Mac (Chitipat Wattanasiripong). Mereka berpacaran hingga Nard hamil. Ibu Mac memaksa Mac untuk tidak menghubungi Nard dan pindah keluar negeri. Sementara Ibu Nard menyuruh Nard untuk melakukan aborsi. Tetapi setelah aborsi nyawa Nard tidak tertolong. Tetapi ia masih hadir dan mulai menghantui serta melakukan teror.', '2018-11-14', '2018-12-11', '98 menit'),
(67, 'Discarnate', 'Mario Sorrenti', 'Horror Thriller', 'Josh Stewart', 'Seorang pakar ahli syaraf terobsesi dengan membuat obat untuk merangsang pikiran manusia ketingkat yang lebih tinggi lagi. Tetapi ia justru melepas sebuah kekuatan supranatural didalam timnya.', '2018-11-20', '2018-12-18', '84 menit'),
(68, 'Extreme Job', 'Lee Byung Heon', 'Comedy Crime', 'Ryu Seung Ryong', 'Sekelompok detektif bagian narkoba membuka restaurant fried chicken untuk penyamaran. Dari restaurant tersebut mereka memata-matai kegiatan bandar narkoba. Tetapi ternyata restaurant mereka memiliki rasa yang enak sehingga restaurant tersebut menjadi sangat ramai dan terkenal.', '2018-11-22', '2018-12-20', '111 menit'),
(69, 'Foxtrot Six', 'Randy Korompis', 'Action', 'Oka Antara', 'Indonesia dikudeta dan diambil alih oleh partai pembelot bernama Piranas. Perubahan iklim yang memburuk membuat makanan menjadi langka dan mahal yang membuat rakyat hidup dalam ketakutan dan kelaparan. Mantan marinir bernama Angga (Oka Antara) bersama ke 5 temannya hanya punya waktu 3 hari untuk menyelamatkan Indonesia dari kehancuran.', '2018-11-30', '2018-12-31', '114 menit'),
(70, 'Anak Hoki', 'Ginanti Rona', 'Comedy Drama', 'Kenny Austin', 'Ahok (Kenny Austin) harus meninggalkan Belitung diusia remaja untuk hidup mandiri di Jakarta. Disana ia bertemu dengan teman-teman barunya yaitu Daniel (Chris Laurent), Bayu (Lolox) dan Eva (Nadine Emanuella Waworuntu). Ia bertekad untuk menerapkan ajaran Ayahnya yaitu selalu menyebarkan kebaikan. Ahok menyadari bahwa tidak selamanya berbuat kebaikan itu menjadi hal mudah, ada kalanya kita perlu berkorban untuk berbuat kebaikan.', '2018-12-05', '2019-01-20', '97 menit'),
(71, '11:11 Apa Yang Kau Lihat', 'Andi Manoppo', 'Horror', 'Rendy Kjaernett', 'Pada pukul 11:11, Galih (Rendy Kjaernett) seorang arkeolog yang juga penyelam menemukan fakta keberadaan Ibunya bernama Dewi (Lady Nayoan) yang hilang ketika Galih masih kecil di Pulau Tanjung Biru. Ia kemudian mengajak teman-temannya ke Pulau Tanjung Biru untuk menemukan jejak keberadaan Ibunya. Namun siluman penjaga Pulau Tanjung Biru mulai menteror dan mengganggu mereka semua.', '2018-12-14', '2019-01-20', '78 menit'),
(72, 'I Still See You', 'Scott Speer', 'Fantasy Thriller', 'Bella Thorne', '10 tahun setelah kejadian bencana hebat yang menewaskan jutaan orang yang membuat dunia ini dipenuhi dengan hantu. Roni (Bella Thorne) menerima pesan ancaman dari dunia lain. Ia bersama temannya mencoba melewati batas dunia lain untuk menghentikan ancaman pembunuhan tersebut.', '2018-12-20', '2019-01-25', '98 menit'),
(73, 'Total Dhamaal', 'Indra Kumar', 'Action', 'Ajay Devgn', 'Guddu (Ajay Devgn) seorang penjahat kelas teri dikhianati oleh temannya Pintu (Manoj Pahwa) setelah mereka berusaha mendapatkan harta karun yang banyak. Guddu dan temannya Johnny (Sanjay Misra) mencari jejak harta karun tersebut. Tetapi Pintu memberikan informasi harta karun tersebut kepada 3 kelompok orang lainnya. Sekarang ada banyak orang yang berusaha lebih dulu untuk menemukan harta karun tersebut.', '2018-12-22', '2019-01-20', '127 menit'),
(74, 'Mia and the White Lion', 'Gilles de Maistre', 'Adventure Family', 'Daniah De Villiers', 'Mia (Daniah De Villiers) berteman baik dengan seekor singa bernama Charlie. Charlie merupakan singa putih yang lahir di peternakan orangtuanya di Afrika Selatan. Ketika Mia berusia 14 tahun dan Charlie sudah besar, Ayahnya berencana menjual Charlie. Mia tidak ingin berpisah dengan Charlie dan ia memutuskan untuk melarikan diri bersama Charlie.', '2018-12-24', '2019-01-25', '98 menit'),
(75, 'Fall in Love at First Kiss', 'Chen Yu Shan', 'Comedy Romance', 'Darren Wang', 'Zhishu Jiang (Darren Wang) adalah laki-laki yang pintar yang ganteng sementara Xiangqin Yuanis (Lin Yun) tidak pintar. Pada hari pertama di kampus mereka bertemu dan secara tidak sengaja berciuman yang membuat Xiangqin jatuh cinta.', '2018-12-30', '2019-01-30', '123 menit'),
(76, 'The Night Eats the World', 'Dominique Rocher', 'Horror', 'Anders Danielsen Lie', 'Setelah terbangun di apartemennya sejak pesta semalaman, Sam (Anders Danielsen Lie) terkejut ketika ia menghadapi kenyataan yang mengerikan. Zombie-zombie memenuhi jalanan Paris dan ia satu-satunya yang selamat. Ia memblokir jalan masuk ke apartemennya dan dalam kesendirian ia berpikir berapa lama ia akan selamat, tetapi ia mulai menyadari bahwa ia bukan satu-satunya yang selamat.', '2019-01-01', '2019-02-02', '93 menit'),
(77, 'Bel Canto', 'Paul Weitz', 'Drama Romance', 'Julianne Moore', 'Roxane Coss (Julianne Moore) penyanyi Soprano terkenal asal Amerika Serikat pergi ke Afrika Selatan untuk konser tunggal pada acara ulang tahun pengusaha Jepang kaya Katsumi Hosokawa (Ken Watanabe). Acara tersebut dihadiri orang-orang penting. Pasukan Gerilya yang dipimpin oleh Benjamin menyerang mereka dan menyandera mereka sebagai ganti untuk kebebasan anak buah mereka yang ditahan.', '2019-01-03', '2019-02-05', '100 menit'),
(78, 'Dillan 1991', 'Fajar Bustomi', 'Drama Romance', 'Iqbaal Dhiafakhri Ramadhan', 'Dilan (Iqbaal Dhiafakhri Ramadhan) dan Milea (Vanesha Priscillia) telah resmi berpacaran pada 22 Desember 1990. Tetapi Dilan terancam dikeluarkan dari sekolah karena sering berkelahi. Mile akhirnya mengancam Dilan untuk keluar dari geng motor atau mereka putus. Tetapi Dilan tetap menjadi panglima tempur dari geng motornya. Masalah bertambah ketika Yugo (Jerome Kurnia) hadir yang merupakan anak dari sepupu jauh Ayah Milea. Yugo baru saja pulang dari Belgia, Yugo dan Milea sering menghabiskan waktu bersama yang membuat Yugo mencintai Milea.', '2019-01-10', '2019-02-10', '121 menit'),
(79, 'Luka Chuppi', 'Laxman Utekar', 'Comedy Romance', 'Kartik Aaryan', 'Menceritakan Guddu (Kartik Aaryan) adalah seorang reporter televisi di Mathura. Ia jatuh cinta dengan Rashmi Trivedi (Kriti Sanon) seorang wanita yang keras kepala.', '2019-05-14', '2019-05-10', '127 menit'),
(80, 'Captain Marvel', 'Anna Boden', 'Action', 'Brie Larson', 'Tahun 1995, Carol Danvers (Brie Larson) mantan pilot pesawat tempur Amerika Serikat berubah menjadi Captain Marvel. Ia menjadi superhero terkuat di jagad raya dan bergabung dengan Starforce, pasukan elite dari alien Kree. Ia akhirnya kembali ke bumi untuk mencari tau latar belakang dan masa lalunya ketika Bumi terjebak diantara konflik dari 2 dunia alien.', '2019-06-02', '2019-07-08', '124 menit'),
(81, 'Reva Guna Guna', 'Jose Poernomo', 'Horror', 'Angel Karamoy', 'Reva (Angel Karamoy) merupakan mahasiswi yang ceria tetapi setelah ulangtahunnya yang ke 21 ia menjadi pendiam dan tidak bergaul. Hingga suatu ketika Ibu dan adiknya tewas terbunuh dan Reva dinyatakan sebagai pembunuh dan dibawa ke Rumah Sakit Jiwa. Devi (Pamela Bowie) sahabat Reva tidak percaya bahwa Reva pembunuhnya, Reva mengatakan bahwa ia diteror mahluk gaib tetapi tidak ada yang percaya hingga Devi diam-diam memasukkan paranormal ke rumah sakit jiwa. Ternyata mahluk gaib itu kiriman seseorang untuk membunuh Reva.', '2019-06-04', '2019-07-09', '80 menit'),
(82, 'Badla', 'Sujoy Ghosh', 'Mystery Thriller', 'Amitabh Bachchan', 'Seorang suami istri pengusaha muda mengalami kejadian aneh ketika sang istri terbangun dan menemukan dirinya didalam kamar hotel yang terkunci. Disampingnya terdapat suaminya yang sudah tidak bernyawa. Ia menyewa pengacara terhebat untuk memecahkan misteri apa yang sebenarnya terjadi.', '2019-06-10', '2019-07-12', '118 menit'),
(83, 'A Private War', 'Matthew Heineman', 'Drama Biography', 'Rosamund Pike', 'Berdasarkan kisah nyata dari Marie Colvin (Rosamund Pike). Ia merupakan jurnalis asal Amerika yang selalu mendokumentasikan peperangan dan telah melalui banyak peperangan. Ia kehilangan sebelah matanya pada tahun 2001 ketika mengikuti pasukan Macan Tamil di Srilanka. Walaupun menderita PTSD, pada tahun 2012 ia berada di Siria dan terjebak disana bersama fotografer Paul Conroy (Jamie Dornan).', '2019-06-20', '2019-07-24', '110 menit'),
(84, 'Misteri Dilaila', 'Syafiq Yusof', 'Horror Thriller', 'Zul Ariffin', 'Sepasang suami istri muda yaitu Jefri (Zul Ariffin) dan Dilaila (Elizabeth Tan) berlibur di sebuah villa di Frasser Hill milik mendiang Ayah Dilaila. Tetapi pada malam pertama Jefri diganggu oleh hal-hal aneh dan gaib yang lebih aneh lagi keesokan harinnya istrinya Dilaila menghilamg. Ia melapor ke polisi untuk mencari istrinya dan kabar gembira datang dari Imam Aziz bahwa istrinya sudah ketemu. Tetapi orang yang muncul bersama Imam Aziz itu bukan istrinya, ia hanya mengaku bahwa ia Dilaila istri Jefri.', '2019-06-28', '2019-08-01', '81 menit'),
(85, 'Wonder Park', 'David Feiss', 'Adventure Animation', 'Brianna Denski', 'June (Brianna Denski) merupakan anak perempuan yang optimis dan penuh imajinasi. Ia waktu kecil berimajinasi memiliki Taman Ria miliknya. Suatu ketika ia menukan Taman Ria tersembunyi yang bernama Wonderland didalam hutan. Taman tersebut penuh dengan berbagai aktrasi dan permainan serta diisi oleh hewan-hewan lucu yang bisa berbicara.', '2019-07-05', '2019-08-15', '93 menit'),
(86, 'Yowis Ben 2', 'Fajar Nugros', 'Comedy Drama', 'Bayu Skak', 'Setelah Bayu (Bayu Skak) diputus oleh Susan (Cut Meyriska), ia dihadapi masalah naiknya harga kontrakan yang membuat ia dan Ibunya dan Cak Jon (Arief Didu) terancam diusir. Yowis Ben jadi satu-satunya harapan Bayu mengatasi masalah keuangan, karena band tersebut masih populer di Malang. Tetapi masing-masing personilnya justru mempunyai masalah masing-masing. Bayu mempercayakan Yowis Ben dipegang Cak Jim (Timo Scheunemann) bule yang mengaku kalau sudah banyak membesarkan artis nasional. Merekapun pindah ke Bandung tetapi justru muncul banyak masalah baru karena Cak Jim ternyata orang yang mencurigakan.', '2019-07-10', '2019-08-14', '110 menit'),
(87, 'Leak (Penangkeb)', 'Mimi Jegon', 'Horror', 'Mangku Tedja Kandel', 'Sekelompok anak muda yaitu Sandra, Yessy, Edy, Kayun dan Yunda ingin membuktikan keanehan di sebuah Villa. Ada sebuah ruangan yang tidak disewakan karena khusus keluarga pemilik Villa, tetapi mereka penasaran dan masuk kesana dan mereka berada dialam gaib. Teror yang mengerikan membuat mereka kembali ke dunia nyata, tetapi teror terus mengikuti mereka.', '2019-07-24', '2019-08-30', '75 menit'),
(88, 'The Sacred Riana: Beginning', 'Billy Christian', 'Horror', 'Frislly Herlinda Balqis', 'Riana (Frislly Herlinda Balqis) semasa kecil tinggal di sebuah kota kecil bersama kedua orangtuanya yang menjalani usaha rumah duka. Tetapi sebuah musibah mengharuskan mereka pindah ke Jakarta di rumah Om Johan (Willem Bevers) dimana Riana bertemu dengan boneka Riani. Bu Klara (Aura Kasih) ingin mengetahui kenapa Riana tidak masuk sekolah dan tingkah lakunya juga semakin aneh, Bu Klara juga menyarankan agar Klara direhabilitasi agar ia dapat kembali bersosialisasi. Tetapi kehadiran Bu Klara justru membuat sesosok mahluk mengerikan dari masa lalu terlepas dan menteror mereka semua.', '2019-07-29', '2019-09-02', '111 menit'),
(89, 'Five Feet Apart', 'Justin Baldoni', 'Drama Romance', 'Haley Lu Richardson', 'Stella Grant (Haley Lu Richardson) seperti kebanyakan remaja 17 tahun lainnya, memiliki sahabat dan ia juga tidak bisa lepas dari laptopnya. Tetapi tidak seperti remaja lainnya ia menderita penyakit Cystic Fibrosis yang mengharuskannya menghabiskan waktu di rumah sakit. Tetapi ketika ia bertemu sesama pasien CF lainnya yaitu Will Newman (Cole Sprouse) semuanya berubah dan mereka saling jatuh cinta. Tetapi antara sesama pasien CF mereka harus menjaga jarak. Mereka tidak boleh bersentuhan dan harus menjaga jarak 1.5 meter antara mereka agar penyakit mereka tidak saling menular dan bertambah parah.', '2019-08-10', '2019-09-12', '116 menit'),
(90, 'Friend Zone', 'Chayanop Boonprakob', 'Comedy Romance', 'Naphat Siangsomboon', 'Palm (Naphat Siangsomboon) selalu dianggap teman oleh sahabatnya yaitu Gink (Pimchanol Luevisadpaibul) selama 10 tahun. Sejak SMA ia berusaha untuk menyatakan perasaannya tetapi Gink selalu menolaknya dan ingin berteman saja. Sejak saat itu mereka menjadi sangat dekat, setiap Palm putus dengan pacarnya ia akan bercerita dengan Gink. Begitu pula dengan Gink setiap kali ia ribut dengan pacarnya maka orang pertama yang ditelepon adalah Palm.', '2019-08-10', '2019-09-14', '118 menit'),
(91, 'The Quake', 'John Andreas Andersen', 'Drama Thriller', 'Kristoffer Joner', 'films ini juga diberi judul Skjelvet. Pada tahun 1904 gempa bumi besar melanda Oslo. Sekarang ada kemungkinan gempa tersebut terjadi lagi di Oslo. Ketika seorang Geologis menemukan bukti-bukti bahwa akan ada gempa besar menyerang Oslo, Norwegia. Maka ia dikejar waktu untuk menyelamatkan Istri dan kedua anaknya dari gempa besar yang melanda Oslo, Norwegia.', '2019-08-16', '2019-09-12', '106 menit'),
(93, 'Kuambil Lagi Hatiku', 'Azhar Kinoi Lubis', 'Comedy Drama', 'Lala Karmela', 'Disuatu tempat di Agra India, Sinta (Lala Karmela) akan menikah dengan Vikash (Sahil Shah). Tetapi menjelang pernikahannya, Ibu Sinta yaitu Widhi Malhotra (Cut Mini) justru pulang ke kampung halamannya di Indonesia. Sinta pun menyusul Ibunya ke Indonesia dan menunda pernikahannya di India. Ketika sampai di Desa Borobudur yang merupakan kampung halaman Widhi, Sinta menemukan kenyataan yang mengejutkan serta rahasia yang kelam mengenai masa lalu Ibunya.', '2019-09-02', '2019-10-01', '123 menit'),
(94, 'Roy Kiyoshi The Untold Story', 'Jose Purnomo', 'Drama Biography', 'Roy Kiyoshi', 'Roy (Roy Kiyoshi) memiliki kemampuan unik yaitu berinteraksi dengan mahluk gaib. Tetapi ketika Rani (Clarice Cutie) adiknya diculik oleh mahluk gaib ia merasa gagal melindungi adiknya dan frustasi. 3 tahun kemudian seorang pekerja LSM bernama Sheila (Olga Lydia) yang sedang menangani kasus anak hilang merasa yakin bahwa kasus yang ia tangani ada hubungannya dengan hilangnya Rani. Anggota LSM sebelumnya yaitu Lisa yang menangani kasus ini sebelumnya juga mati mengenaskan yang menguatkan Sheila akan adanya campur tangan mahluk gaib dalam kasus ini.', '2019-09-18', '2019-10-10', '86 menit'),
(95, 'Pohon Terkenal', 'Monty Tiwa', 'Drama', 'Umay Shahab', 'Tiga orang remaja harus meninggalkan kehidupan remaja normal ketika mereka masuk sebagai taruna di Akamedi Kepolisian Semarang. Mereka adalah Bara (Umay Shahab), Ayu (Laura Theux) dan Johanes Solossa (Raim Laode) ketika mereka harus bertahan dan tidak boleh menyerah. Tetapi semua bertambah rumit ketika cinta hadir dan mereka mempertaruhkan masa depan mereka.', '2019-09-22', '2019-10-24', '96 menit'),
(96, 'Mard Ko Dard Nahi Hota', 'Vasan Bala', 'Action Comedy', 'Abhimanyu Dasani', 'Surya (Abimanyu Dassani) terlahir dengan kelainan penyakit yang aneh yang merupakan kombinasi keturunan dari Ayah dan Kakeknya. Ia menderita penyakit yang membuat dirinya tidak bisa merasakan sakit. Keanehannya ini membuat ia belajar bela diri untuk menjadi superhero dan melawan orang-orang jahat.', '2019-09-30', '2019-11-02', '134 menit'),
(97, 'On The Basis Of Sex', 'Mimi Leder', 'Drama Biography', 'Felicity Jones', 'Terinsipirasi dari kisah nyata Ruth Bader Ginsburg (Felicity Jones). Ia merupakan pengacara yang berjuang mendapatkan persamaan hak antara pria dan wanita pada tahun 1970an. Sebuah kasus pajak yang ia tangani dan suaminya Martin D. Ginsburg (Armie Hammer) memberinya peluang untuk karirnya dan yang terpenting memberinya kesempatan agar pengadilan mengubah cara pandang tentang diskriminasi gender antara pria dan wanita.', '2019-10-04', '2019-11-05', '120 menit'),
(98, 'Triple Threat', 'Jesse V. Johnson', 'Action Thriller', 'Iko Uwais', 'Sekelompok sindikat kriminal mengincar seorang anak perempuan dari Milyader asal China. Anak perempuan tersebut menjadi target pasukan pembunuh elit. Sekelompok orang yang merupakan tentara bayaran berusaha melindunginya. Melawan setiap pembunuh yang datang untuk mengincar targetnya.', '2019-10-11', '2019-11-15', '96 menit'),
(99, 'Kesari', 'Anurag Singh', 'Action Historical', 'Akshay Kumar', 'Berdasarkan kisah nyata yang dikenal dengan Battle of Saragarhi. Peristiwa ini terjadi pada tahun 1987 dimana Sikh Regiment yang merupakan bagian dari Tentara Inggris yang berjumlah 21 tentara berperang melawan 10.000 tentara Afghanistan yang merupakan gabungan manusia gunung Afridi dan Orakzai.K', '2019-10-20', '2019-11-25', '150 menit'),
(100, 'All The Devils Men', 'Matthew Hope', 'Action', 'Milo Gibson', 'Jack Collins (Milo Gibson) seorang mantan Navy SEAL yang sekarang telah menjadi tentara bayaran. Ia mendapatkan misi yang paling mematikan di London. Ternyata misi tersebut membuatnya bertemu kembali dengan teman-temannya dulu di Navy Seal dan juga rekan-rekan sesama tentara bayaran.', '2019-11-02', '2019-12-04', '99 menit'),
(101, 'Dumplin', 'Anne Fletcher', 'Comedy Musical', 'Danielle MacDonald', 'Willowdean (Danielle MacDonald) atau biasa dipanggil Dumplin oleh Ibunya merupakan anak perempuan remaja dengan ukuran tubuh yang besar. Ibunya (Jennifer Aniston) merupakan mantan ratu kecantikan yang selalu meremehkan Dumplin. Dumplin memutuskan untuk mengikuti kontes Ratu Kecantikan sebagai bentuk protes kepada Ibunya dan ingin membuktikan bahwa ia bisa memenangkan kontes ratu kencantikan.', '2019-11-07', '2019-12-12', '110 menit'),
(102, 'The Hole In The Ground', 'Lee Cronin', 'Horror', 'Seane Kerslake', 'Seorang Ibu muda bernama Sarah (Seane Kerslake) tinggal dipinggiran Irlandia dengan anaknya. Pada suatu malam anaknya menghilang didalam hutan dipinggiran rumahnya. Ketika kembali kelakuan anaknya menjadi aneh dan tidak biasa. Sarah merasa bahwa anak yang kembali tersebut bukan anaknya.', '2019-11-10', '2019-12-12', '90 menit'),
(103, 'Arctic', 'Joe Pena', 'Adventure Drama', 'Mads Mikkelsen', 'Seorang pria (Mads Mikkelsen) terdampar di Antartika ketika pesawatnya jatuh. Ia membuat camp sementara dengan pesawatnya tetapi ia harus memutuskan untuk tetap berada di lokasinya sekarang yang relatif aman atau pergi melakukan perjalanan untuk mencari bantuan.', '2019-11-10', '2019-12-15', '98 menit'),
(104, 'Dumbo', 'Tim Burton', 'Drama', 'Danny DeVito', 'Seorang pemilik sirkus bernama Max Medici (Danny DeVito) meminta tolong Holt Farrier (Colin Farrell) untuk mengurus seekor gajah yang baru lahir. Gajah tersebut bertelinga besar dan menjadi bahan tertawaan di sirkus yang sedang berjuang agar tidak bangkrut tersebut. Tetapi ketika anak-anak Holt menemukan bahwa gajah tersebut bisa terbang maka semuanya berusaha membuat agar gajah yang bernama Dumbo tersebut menjadi seorang bintang.', '2019-11-24', '2019-12-26', '115 menit');
